        /// <summary>
        /// Defines the entirety of the WorkingStorage IRecord structure as described by the Ateras.Framework.Buffer API.
        /// </summary>
        /// <param name="recordDef">The IStructureDefinition object to be used in defining the record structure.</param>
        protected override void DefineRecordStructure(IStructureDefinition recordDef)
        {

            recordDef.CreateNewGroup(Names.WS_SWITCHES, (WS_SWITCHES) =>
           {
               WS_SWITCHES.CreateNewField(Names.WS_STATUS, FieldType.UnsignedNumeric, 2);
               WS_SWITCHES.CreateNewField(Names.WS_STATUS_I, FieldType.UnsignedNumeric, 2);
               WS_SWITCHES.CreateNewField(Names.WS_SUBSCRIPT, FieldType.UnsignedNumeric, 2);
               WS_SWITCHES.CreateNewField(Names.SUB1, FieldType.PackedDecimal, 3, +0);
               WS_SWITCHES.CreateNewField(Names.SUB2, FieldType.PackedDecimal, 3, +0);
               WS_SWITCHES.CreateNewField(Names.WS_FOUND_SIGNIFIC_DIGIT_FLAG, FieldType.String, 1, SPACES)
                   .NewCheckField(Names.WS_FOUND_SIGNIFIC_DIGIT, "Y")
                   ;
           });

            recordDef.CreateNewGroup(Names.WS_VARIABLES, (WS_VARIABLES) =>
           {
               WS_VARIABLES.CreateNewGroup(Names.WS_HEADER, (WS_HEADER) =>
               {
                   WS_HEADER.CreateNewField(Names.OH_LOCAL_FIPS_STATE, FieldType.UnsignedNumeric, 2);
                   WS_HEADER.CreateNewField(Names.OH_LOCAL_FIPS_COUNTY, FieldType.UnsignedNumeric, 3);
                   WS_HEADER.CreateNewField(Names.OH_LOCAL_FIPS_SUB, FieldType.UnsignedNumeric, 2);
                   WS_HEADER.CreateNewField(Names.OH_OTHER_FIPS_STATE, FieldType.UnsignedNumeric, 2);
                   WS_HEADER.CreateNewField(Names.OH_OTHER_FIPS_COUNTY, FieldType.UnsignedNumeric, 3);
                   WS_HEADER.CreateNewField(Names.OH_OTHER_FIPS_SUB, FieldType.UnsignedNumeric, 2);
                   WS_HEADER.CreateNewField(Names.OH_CSENET_VERSION_NUMBER, FieldType.String, 3);
                   WS_HEADER.CreateNewField(Names.OH_TRANSACTION_SERIAL, FieldType.UnsignedNumeric, 12);
                   WS_HEADER.CreateNewField(Names.OH_ERROR_REASON_CODE, FieldType.String, 2);
                   WS_HEADER.CreateNewField(Names.OH_TRANSACTION_TYPE, FieldType.String, 2);
                   WS_HEADER.CreateNewField(Names.OH_ACTION_CODE, FieldType.String, 1);
                   WS_HEADER.CreateNewField(Names.OH_FUNCTIONAL_TYPE_CODE, FieldType.String, 3);

                   IField OH_TRANSACTION_DATE_local = WS_HEADER.CreateNewField(Names.OH_TRANSACTION_DATE, FieldType.UnsignedNumeric, 8);
                   WS_HEADER.CreateNewFieldRedefine(Names.OH_TRANSACTION_DATE_TEXT, FieldType.String, OH_TRANSACTION_DATE_local, 8);
