            //COMMENT: ************************************************************
            M_3110_BUILD_HEADER("M_3110_EXIT"); if (Control.ExitProgram) { return; }                              //COBOL==> PERFORM 3110-BUILD-HEADER THRU 3110-EXIT
            if (LS.CASE_DATA_IND_0001.IsGreaterThan(0))                                                         //COBOL==> IF ( CASE-DATA-IND-0001 > 0 )
            {
                M_3120_CREATE_CASE_DATA_BLOCK("M_3120_EXIT"); if (Control.ExitProgram) { return; }                    //COBOL==> PERFORM 3120-CREATE-CASE-DATA-BLOCK THRU 3120-EXIT
            }                                                                                                   //COBOL==> END-IF
