            {
                M_3130_CREATE_AP_ID_DATA_BLOCK("M_3130_EXIT"); if (Control.ExitProgram) { return; }                   //COBOL==> PERFORM 3130-CREATE-AP-ID-DATA-BLOCK THRU 3130-EXIT
            }                                                                                                   //COBOL==> END-IF
            if (LS.AP_LOCATE_DATA_IND_0001.IsGreaterThan(0))                                                    //COBOL==> IF ( AP-LOCATE-DATA-IND-0001 > 0 )
            {
                M_3140_CREATE_AP_LOC_DATA_BLOCK("M_3140_EXIT"); if (Control.ExitProgram) { return; }                  //COBOL==> PERFORM 3140-CREATE-AP-LOC-DATA-BLOCK THRU 3140-EXIT
            }                                                                                                   //COBOL==> END-IF
            for (WS.WS_SUBSCRIPT.SetValue(1); (!(WS.WS_SUBSCRIPT.IsGreaterThan(LS.PARTICIPANT_DATA_IND_0001))); WS.WS_SUBSCRIPT.Add(1))  //COBOL==> PERFORM 3150-CREATE-PAR-DATA-BLOCK THRU 3150-EXIT VARYING WS-SUBSCRIPT FROM 1 BY 1 UNTIL ( WS-SUBSCRIPT > PARTICIPANT-DATA-IND-0001 )
            {
                M_3150_CREATE_PAR_DATA_BLOCK("M_3150_EXIT"); if (Control.ExitProgram) { return; }
            }
            for (WS.WS_SUBSCRIPT.SetValue(1); (!(WS.WS_SUBSCRIPT.IsGreaterThan(LS.ORDER_DATA_IND_0001))); WS.WS_SUBSCRIPT.Add(1))  //COBOL==> PERFORM 3160-CREATE-ORDER-DATA-BLOCK THRU 3160-EXIT VARYING WS-SUBSCRIPT FROM 1 BY 1 UNTIL ( WS-SUBSCRIPT > ORDER-DATA-IND-0001 )
            {
                M_3160_CREATE_ORDER_DATA_BLOCK("M_3160_EXIT"); if (Control.ExitProgram) { return; }
            }
            for (WS.WS_SUBSCRIPT.SetValue(1); (!(WS.WS_SUBSCRIPT.IsGreaterThan(LS.COLLECTION_DATA_IND_0001))); WS.WS_SUBSCRIPT.Add(1))  //COBOL==> PERFORM 3170-CREATE-COL-DATA-BLOCK THRU 3170-EXIT VARYING WS-SUBSCRIPT FROM 1 BY 1 UNTIL ( WS-SUBSCRIPT > COLLECTION-DATA-IND-0001 )
            {
