            }
            if (LS.INFORMATION_IND_0001.IsGreaterThan(0))                                                       //COBOL==> IF ( INFORMATION-IND-0001 > 0 )
            {
                M_3180_CREATE_INFO_DATA_BLOCK("M_3180_EXIT"); if (Control.ExitProgram) { return; }                    //COBOL==> PERFORM 3180-CREATE-INFO-DATA-BLOCK THRU 3180-EXIT
            }                                                                                                   //COBOL==> END-IF .
            if (returnMethod != "" && returnMethod != "M_3100_PROCESS_RECORD") { M_3100_PROCESS_RECORD_EXIT(returnMethod); }  //Check for pass through to next method
