        /// </summary>
        /// <remarks>
        ///COMMENT: ************************************************************
        ///COMMENT: *  THIS INCLUDE PROCESSES                                 **
        ///COMMENT: *  THE INCOMING CSENET TRANSACTION RECORD                 **
        ///COMMENT: ************************************************************
        ///COMMENT: ************************************************************
        ///COMMENT: *  PROCESS THE INCOMING CSENET TRANSACTION RECORD         **
        ///COMMENT: *     THIS 'INCLUDE' IS USED IN SWEXIE01                  **
        ///COMMENT: ************************************************************
        ///COMMENT: ************************************************************
        ///COMMENT: *  PROCESSING DESCRIPTION                                 **
        ///COMMENT: *=========================================================**
        ///COMMENT: *  READ A RECORD FROM INPUT FILE                          **
        ///COMMENT: *  PROCESS RECORD (PLACE READ DATA INTO EXPORT VIEWS)     **
        ///COMMENT: *    PROCESS HEADER                                       **
        ///COMMENT: *    DETERMINE NEXT DATA BLOCK TYPE                       **
        ///COMMENT: *    BASED ON THE TYPE, PROCESS THE NEXT DATA BLOCK       **
        ///COMMENT: *      POSSIBLE TYPES:                                    **
        ///COMMENT: *        CASE         AP ID        AP LOCATE              **
        ///COMMENT: *        PARTICIPANT  ORDER        COLLECTION             **
        ///COMMENT: *        INFORMATION                                      **
        ///COMMENT: ************************************************************
        ///COMMENT: ************************************************************
        ///COMMENT: *  MAINTENANCE LOG                                        **
        ///COMMENT: *=========================================================**
        ///COMMENT: *  1999/04/15   M RAMIREZ     INITIAL DEVELOPMENT         **
        ///COMMENT: *  1999/07/19   M RAMIREZ     ADDED DATE VALIDATION       **
        ///COMMENT: *                             SUBROUTINE                  **
        ///COMMENT: *                                                         **
        ///COMMENT: ************************************************************
        /// </remarks>
        private void M_4000_READ_FILE(string returnMethod = "")
        {
            M_4100_READ_RECORD("M_4100_READ_RECORD_EXIT"); if (Control.ExitProgram) { return; }                   //COBOL==> PERFORM 4100-READ-RECORD THRU 4100-READ-RECORD-EXIT
            if (LS.TEXT_RETURN_CODE_0118.IsLessThanOrEqualTo(SPACES))                                           //COBOL==> IF ( TEXT-RETURN-CODE-0118 <= SPACES )
            {
                M_4200_PROCESS_RECORD("M_4200_PROCESS_RECORD_EXIT"); if (Control.ExitProgram) { return; }             //COBOL==> PERFORM 4200-PROCESS-RECORD THRU 4200-PROCESS-RECORD-EXIT
            }                                                                                                   //COBOL==> END-IF .
