        /// </summary>
        private void M_4100_READ_RECORD(string returnMethod = "")
        {
            //COMMENT: ************************************************************
            //COMMENT: *  READ A RECORD FROM INPUT FILE                          **
            //COMMENT: ************************************************************
            FD.INPUT_CSENET_FILE.ReadLine();                                                                    //COBOL==> READ INPUT-CSENET-FILE
            if (FD.INPUT_CSENET_FILE.FileStatus == FileStatus.End_of_file)                                      //COBOL==> AT END
            {
                LS.TEXT_RETURN_CODE_0118.SetValue("EF");                                                            //COBOL==> MOVE 'EF' TO TEXT-RETURN-CODE-0118
                LS.NUMERIC_RETURN_CODE_0118.SetValue(WS.WS_STATUS_I);                                               //COBOL==> MOVE WS-STATUS-I TO NUMERIC-RETURN-CODE-0118
                M_4100_READ_RECORD_EXIT(CheckGotoReturn(returnMethod)); return;                                     //COBOL==> GO TO 4100-READ-RECORD-EXIT.
            }
            WS.WS_OUTPUT_LINE.SetValue(FD.INPUT_CSENET_RECORD);                                                 //COBOL==> MOVE INPUT-CSENET-RECORD TO WS-OUTPUT-LINE .
            if (returnMethod != "" && returnMethod != "M_4100_READ_RECORD") { M_4100_READ_RECORD_EXIT(returnMethod); }  //Check for pass through to next method
        }
