        /// <summary>
        /// Method M_4200_PROCESS_RECORD
        /// </summary>
        private void M_4200_PROCESS_RECORD(string returnMethod = "")
        {
            //COMMENT: ************************************************************
            //COMMENT: *  PROCESS RECORD (PLACE READ DATA INTO EXPORT VIEWS)     **
            //COMMENT: ************************************************************
            M_4210_BUILD_HEADER("M_4210_EXIT"); if (Control.ExitProgram) { return; }                              //COBOL==> PERFORM 4210-BUILD-HEADER THRU 4210-EXIT
            if (WS.OH_CASE_DATA_IND.IsGreaterThan(0))                                                           //COBOL==> IF ( OH-CASE-DATA-IND > 0 )
            {
                M_4220_CREATE_CASE_DATA_BLOCK("M_4220_EXIT"); if (Control.ExitProgram) { return; }                    //COBOL==> PERFORM 4220-CREATE-CASE-DATA-BLOCK THRU 4220-EXIT
            }                                                                                                   //COBOL==> END-IF
            if (WS.OH_AP_IDENTIFICATION_IND.IsGreaterThan(0))                                                   //COBOL==> IF ( OH-AP-IDENTIFICATION-IND > 0 )
            {
                M_4230_CREATE_AP_ID_DATA_BLOCK("M_4230_EXIT"); if (Control.ExitProgram) { return; }                   //COBOL==> PERFORM 4230-CREATE-AP-ID-DATA-BLOCK THRU 4230-EXIT
            }                                                                                                   //COBOL==> END-IF
            if (WS.OH_AP_LOCATE_DATA_IND.IsGreaterThan(0))                                                      //COBOL==> IF ( OH-AP-LOCATE-DATA-IND > 0 )
            {
                M_4240_CREATE_AP_LOC_DATA_BLOCK("M_4240_EXIT"); if (Control.ExitProgram) { return; }                  //COBOL==> PERFORM 4240-CREATE-AP-LOC-DATA-BLOCK THRU 4240-EXIT
            }                                                                                                   //COBOL==> END-IF
            for (WS.WS_SUBSCRIPT.SetValue(1); (!(WS.WS_SUBSCRIPT.IsGreaterThan(WS.OH_PARTICIPANT_DATA_IND))); WS.WS_SUBSCRIPT.Add(1))  //COBOL==> PERFORM 4250-CREATE-PAR-DATA-BLOCK THRU 4250-EXIT VARYING WS-SUBSCRIPT FROM 1 BY 1 UNTIL ( WS-SUBSCRIPT > OH-PARTICIPANT-DATA-IND )
            {
                M_4250_CREATE_PAR_DATA_BLOCK("M_4250_EXIT"); if (Control.ExitProgram) { return; }
            }
            for (WS.WS_SUBSCRIPT.SetValue(1); (!(WS.WS_SUBSCRIPT.IsGreaterThan(WS.OH_ORDER_DATA_IND))); WS.WS_SUBSCRIPT.Add(1))  //COBOL==> PERFORM 4260-CREATE-ORDER-DATA-BLOCK THRU 4260-EXIT VARYING WS-SUBSCRIPT FROM 1 BY 1 UNTIL ( WS-SUBSCRIPT > OH-ORDER-DATA-IND )
            {
