        /// <summary>
        /// Method M_4290_FORMAT_AMOUNT
        /// </summary>
        private void M_4290_FORMAT_AMOUNT(string returnMethod = "")
        {
            WS.WS_AMOUNT_NUMERIC.SetValue(ZEROES);                                                              //COBOL==> MOVE ZEROES TO WS-AMOUNT-NUMERIC
            if (WS.WS_AMOUNT_DOLLARS.IsNumericValue())                                                          //COBOL==> IF ( WS-AMOUNT-DOLLARS IS NUMERIC )
            {
                WS.WS_AMOUNT_NUMERIC.SetValue(WS.WS_AMOUNT_DOLLARS.AsInt() * 100);                                  //COBOL==> MULTIPLY WS-AMOUNT-DOLLARS BY 100 GIVING WS-AMOUNT-NUMERIC
            }                                                                                                   //COBOL==> END-IF
            if (WS.WS_AMOUNT_CENTS.IsNumericValue())                                                            //COBOL==> IF ( WS-AMOUNT-CENTS IS NUMERIC )
            {
                WS.WS_AMOUNT_NUMERIC.Add(WS.WS_AMOUNT_CENTS.AsDecimal());                                           //COBOL==> ADD WS-AMOUNT-CENTS TO WS-AMOUNT-NUMERIC
            }                                                                                                   //COBOL==> END-IF
            if (WS.WS_AMOUNT_NUMERIC.IsGreaterThan(0))                                                          //COBOL==> IF ( WS-AMOUNT-NUMERIC > 0 )
            {
                WS.WS_AMOUNT_NUMERIC.SetValue(WS.WS_AMOUNT_NUMERIC.AsDecimal() / 100m);                             //COBOL==> DIVIDE WS-AMOUNT-NUMERIC BY 100 GIVING WS-AMOUNT-NUMERIC
            }                                                                                                   //COBOL==> END-IF
            if (WS.WS_AMOUNT_SIGN.IsEqualTo(WS.WS_NEGATIVE_SIGN))                                               //COBOL==> IF ( WS-AMOUNT-SIGN = WS-NEGATIVE-SIGN )
            {
                WS.WS_AMOUNT_NUMERIC.SetValue(WS.WS_AMOUNT_NUMERIC.AsDecimal() * -1m);                              //COBOL==> MULTIPLY WS-AMOUNT-NUMERIC BY -1 GIVING WS-AMOUNT-NUMERIC
            }                                                                                                   //COBOL==> END-IF
            WS.WS_AMOUNT_TEXT.SetValueWithSpaces();                                                             //COBOL==> MOVE SPACES TO WS-AMOUNT-TEXT .
            if (returnMethod != "" && returnMethod != "M_4290_FORMAT_AMOUNT") { M_4290_FORMAT_AMOUNT_EXIT(returnMethod); }  //Check for pass through to next method
        }
