        }
        /// <summary>
        /// Method M_4300_FORMAT_DATE
        /// </summary>
        private void M_4300_FORMAT_DATE(string returnMethod = "")
        {
            WS.WS_DATE_NUMERIC.SetValue(WS.WS_NULL_DATE_NUMERIC);                                               //COBOL==> MOVE WS-NULL-DATE-NUMERIC TO WS-DATE-NUMERIC
            if (WS.WS_DATE_TEXT.IsGreaterThan(SPACES))                                                          //COBOL==> IF ( WS-DATE-TEXT > SPACES )
            {
                if ((WS.WS_DATE_YEAR.IsNumericValue())
             && (WS.WS_DATE_YEAR_NUMERIC.IsGreaterThan(0)))  //COBOL==> IF ( WS-DATE-YEAR IS NUMERIC ) AND ( WS-DATE-YEAR-NUMERIC > 0 )
                {
                    if ((WS.WS_DATE_MONTH.IsNumericValue())
             && (WS.WS_DATE_MONTH_NUMERIC.IsGreaterThan(0)))  //COBOL==> IF ( WS-DATE-MONTH IS NUMERIC ) AND ( WS-DATE-MONTH-NUMERIC > 0 )
                    {
                        if ((WS.WS_DATE_DAY.IsNumericValue())
             && (WS.WS_DATE_DAY_NUMERIC.IsGreaterThan(0))) //COBOL==> IF ( WS-DATE-DAY IS NUMERIC ) AND ( WS-DATE-DAY-NUMERIC > 0 )
                        {
                            WS.WS_DATE_NUMERIC.SetValue(WS.WS_DATE_TEXT);                                                       //COBOL==> MOVE WS-DATE-TEXT TO WS-DATE-NUMERIC
                            if (WS.WS_DATE_NUMERIC.IsGreaterThan(WS.WS_MAX_DATE_NUMERIC))                                       //COBOL==> IF ( WS-DATE-NUMERIC > WS-MAX-DATE-NUMERIC )
                            {
                                WS.WS_DATE_NUMERIC.SetValue(WS.WS_MAX_DATE_NUMERIC);                                                //COBOL==> MOVE WS-MAX-DATE-NUMERIC TO WS-DATE-NUMERIC
                            }                                                                                                   //COBOL==> END-IF
                        }                                                                                                   //COBOL==> END-IF
                    }                                                                                                   //COBOL==> END-IF
                }                                                                                                   //COBOL==> END-IF
            }                                                                                                   //COBOL==> END-IF
            WS.WS_DATE_TEXT.SetValueWithSpaces();                                                               //COBOL==> MOVE SPACES TO WS-DATE-TEXT .
            if (returnMethod != "" && returnMethod != "M_4300_FORMAT_DATE") { M_4300_FORMAT_DATE_EXIT(returnMethod); }  //Check for pass through to next method
        }
